import React from 'react';

function Hello() {
    const [hello, setHello] = React.useState('Whatever');

    function change () {
        setHello('HEY WADDAP');
    };

    return(
        <>
            <div>
                {hello}
            </div>
            <button onClick={change}>Change</button>
        </>
    );
};

export default Hello;
